import React from 'react';
import './App.css';
import {Table} from "antd";

function App() {
    const columns = [
        {
            title: 'Name',
            dataIndex: 'name',
            key: 'name',
        },
        {
            title: 'Age',
            dataIndex: 'age',
            key: 'age',
        },
        {
            title: 'Address',
            dataIndex: 'address',
            key: 'address',
        },
    ];
  return (
    <div className="App">
<Table dataSource={dataSource} columns={columns}/>
    </div>
  );
}

export default App;
